INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, 1, 0.0, 0, -363.0, 106001, 0, 0.0, "2030/12/17 14:59:59", 7001, "2015/12/17 15:00:00", "キャル", 7);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, 1, 0.0, 0, -363.0, 105901, 0, 0.0, "2030/12/17 14:59:59", 7002, "2015/12/17 15:00:00", "コッコロ", 7);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, 1, 0.0, 0, -363.0, 105801, 0, 0.0, "2030/12/17 14:59:59", 7003, "2015/12/17 15:00:00", "ペコリーヌ", 7);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, 1, 0.0, 0, -363.0, 105801, 0, 0.0, "2030/12/17 14:59:59", 10001, "2015/12/17 15:00:00", "ペコリーヌ", 10);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, 1, 0.0, 0, -363.0, 106001, 0, 0.0, "2030/12/17 14:59:59", 10002, "2015/12/17 15:00:00", "キャル", 10);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, 1, 0.0, 0, -363.0, 105901, 0, 0.0, "2030/12/17 14:59:59", 10003, "2015/12/17 15:00:00", "コッコロ", 10);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 2, 1, 0.0, 2104010, -363.0, 106401, 0, 0.0, "2030/12/17 14:59:59", 10004, "2015/12/17 15:00:00", "シェフィ", 10);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, 1, 0.0, 0, -416.5, 105801, 0, 0.0, "2030/12/17 14:59:59", 12001, "2015/12/17 15:00:00", "ペコリーヌ", 12);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, 1, 0.0, 0, -363.0, 106001, 0, 0.0, "2030/12/17 14:59:59", 13001, "2015/12/17 15:00:00", "キャル", 13);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, 1, 0.0, 0, -363.0, 105901, 0, 0.0, "2030/12/17 14:59:59", 13002, "2015/12/17 15:00:00", "コッコロ", 13);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 2, 1, 0.0, 2104010, -363.0, 106401, 0, 0.0, "2030/12/17 14:59:59", 13003, "2015/12/17 15:00:00", "シェフィ", 13);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, 1, 0.0, 0, -363.0, 105801, 0, 0.0, "2030/12/17 14:59:59", 13004, "2015/12/17 15:00:00", "ペコリーヌ", 13);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, 1, 0.0, 0, -363.0, 105901, 0, 0.0, "2030/12/17 14:59:59", 14001, "2015/12/17 15:00:00", "コッコロ", 14);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 2, 1, 0.0, 2104010, -363.0, 106401, 0, 0.0, "2030/12/17 14:59:59", 14002, "2015/12/17 15:00:00", "シェフィ", 14);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, 1, 0.0, 0, -363.0, 105801, 0, 0.0, "2030/12/17 14:59:59", 14003, "2015/12/17 15:00:00", "ペコリーヌ", 14);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, 1, 0.0, 0, -363.0, 106001, 0, 0.0, "2030/12/17 14:59:59", 14004, "2015/12/17 15:00:00", "キャル", 14);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, 1, 0.0, 0, -470.0, 105901, 0, 0.0, "2030/12/17 14:59:59", 15001, "2015/12/17 15:00:00", "コッコロ", 15);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 2, 1, 0.0, 2104010, -363.0, 106401, 0, 0.0, "2030/12/17 14:59:59", 16001, "2015/12/17 15:00:00", "シェフィ", 16);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, 1, 0.0, 0, -363.0, 105801, 0, 0.0, "2030/12/17 14:59:59", 16002, "2015/12/17 15:00:00", "ペコリーヌ", 16);
