INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, 1, 0.0, 0, -363.0, 105801, 0, 0.0, "2030/12/17 14:59:59", 17007, "2015/12/17 15:00:00", "ペコリーヌ", 25);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, 1, 0.0, 0, -363.0, 190801, 0, 0.0, "2030/12/17 14:59:59", 18001, "2015/12/17 15:00:00", "カリン", 18);
