INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (6, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 1, 1, 0.0, 0, -470.0, 190801, 0, 0.0, "2030/12/17 14:59:59", 20002, "2015/12/17 15:00:00", "カリン", 20);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, 1, 0.0, 0, -363.0, 106001, 0, 0.0, "2030/12/17 14:59:59", 21001, "2015/12/17 15:00:00", "キャル", 21);
