INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 2, 1, 0.0, 2104010, -363.0, 106401, 0, 0.0, "2030/12/17 14:59:59", 21003, "2015/12/17 15:00:00", "シェフィ", 21);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, 1, 0.0, 0, -363.0, 105801, 0, 0.0, "2030/12/17 14:59:59", 21004, "2015/12/17 15:00:00", "ペコリーヌ", 21);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, 1, 0.0, 0, -430.0, 190801, 0, 0.0, "2030/12/17 14:59:59", 22001, "2015/12/17 15:00:00", "カリン", 22);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 1, 1, 0.0, 0, -430.0, 190801, 0, 0.0, "2030/12/17 14:59:59", 22002, "2015/12/17 15:00:00", "カリン", 22);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (3, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 1, 1, 0.0, 0, -430.0, 190801, 0, 0.0, "2030/12/17 14:59:59", 23001, "2015/12/17 15:00:00", "カリン", 23);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (4, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 1, 1, 0.0, 0, -430.0, 190801, 0, 0.0, "2030/12/17 14:59:59", 23002, "2015/12/17 15:00:00", "カリン", 23);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, 2, 8.0, 0, -385.0, 109001, 10011, 4.08, "2030/12/17 14:59:59", 24001, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 1, 2, 8.0, 0, -385.0, 109001, 10011, 5.0, "2030/12/17 14:59:59", 24002, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (3, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 1, 2, 8.0, 0, -385.0, 109001, 10011, 10.11, "2030/12/17 14:59:59", 24003, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (4, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 1, 2, 8.0, 0, -385.0, 109001, 10011, 4.0, "2030/12/17 14:59:59", 24004, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (5, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 1, 2, 8.0, 0, -385.0, 109001, 10011, 6.0, "2030/12/17 14:59:59", 24005, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (6, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 1, 1, 0.0, 0, 0.0, 109002, 10011, 0.0, "2030/12/17 14:59:59", 24006, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (7, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 1, 1, 0.0, 0, 0.0, 109002, 10011, 0.0, "2030/12/17 14:59:59", 24007, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (8, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 1, 1, 0.0, 0, 0.0, 109002, 10011, 0.0, "2030/12/17 14:59:59", 24008, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (9, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 1, 1, 0.0, 0, 0.0, 109002, 10011, 0.0, "2030/12/17 14:59:59", 24009, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 1, 1, 0.0, 0, 0.0, 109002, 10011, 0.0, "2030/12/17 14:59:59", 24010, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, 2, 8.0, 0, -385.0, 109101, 10011, 2.12, "2030/12/17 14:59:59", 24011, "2019/01/31 12:00:00", "シズル（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 5, 2, 8.0, 0, -385.0, 109101, 10011, 4.19, "2030/12/17 14:59:59", 24012, "2019/01/31 12:00:00", "シズル（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (3, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 2, 4, 8.0, 0, -385.0, 109101, 10011, 2.3, "2030/12/17 14:59:59", 24013, "2019/01/31 12:00:00", "シズル（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (4, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 1, 1, 0.0, 0, 0.0, 109102, 10011, 0.0, "2030/12/17 14:59:59", 24014, "2019/01/31 12:00:00", "シズル（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (5, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, 2, 8.0, 0, -385.0, 109101, 10011, 5.23, "2030/12/17 14:59:59", 24015, "2019/01/31 12:00:00", "シズル（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (6, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 1, 1, 0.0, 0, 0.0, 109102, 10011, 0.0, "2030/12/17 14:59:59", 24016, "2019/01/31 12:00:00", "シズル（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (7, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 1, 2, 8.0, 0, -385.0, 109101, 10011, 5.01, "2030/12/17 14:59:59", 24017, "2019/01/31 12:00:00", "シズル（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (8, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 1, 1, 0.0, 0, 0.0, 109102, 10011, 0.0, "2030/12/17 14:59:59", 24018, "2019/01/31 12:00:00", "シズル（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (9, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 1, 1, 0.0, 0, 0.0, 109102, 10011, 0.0, "2030/12/17 14:59:59", 24019, "2019/01/31 12:00:00", "シズル（バレンタイン）", 24);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 1, 1, 0.0, 0, 0.0, 109102, 10011, 0.0, "2030/12/17 14:59:59", 24020, "2019/01/31 12:00:00", "シズル（バレンタイン）", 24);
