INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 1, 1, 0.0, 0, -416.5, 123001, 0, 0.0, "2030/12/17 14:59:59", 43005, "2015/12/17 15:00:00", "アメス", 44);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (3, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 1, 2, 0.0, 0, -416.5, 123001, 0, 5.79, "2030/12/17 14:59:59", 43006, "2015/12/17 15:00:00", "アメス", 45);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 1, 1, 0.0, 0, -371.5, 123001, 0, 0.0, "2030/12/17 14:59:59", 46001, "2015/12/17 15:00:00", "アメス", 46);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 2, 2, 0.0, 0, -416.5, 104901, 0, 0.0, "2030/12/17 14:59:59", 47001, "2015/12/17 15:00:00", "シズル", 47);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 1, 2, 0.0, 0, -416.5, 101101, 0, 9.32, "2030/12/17 14:59:59", 47002, "2015/12/17 15:00:00", "リノ", 47);
